import React from 'react';

const newsList = (props) =>{
    //console.log(props);
    
    const items= props.news.map((item)=>{
        return(
            <div>
                <h2>{item.title}</h2>
            </div>
        )
    })
    return(
        <div>Hi, newsList here</div>
    )
}

export default newsList;
